  true,\n\t\"url\": null,\n\t\"notes\": \"ML1RADD is the EOS Aura Microwave Limb Sounder
  (MLS) product containing the level 1 radiances from the digital autocorrelators.
  The current version is 3.3/3.4. Data coverage is complete from August 8, 2004 to
  current. Spatial coverage is near-global (-82 deg. to +82 deg. latitude), files
  contain a full days worth of data (15 orbits). Users of the ML1RADD data product
  should read the 'A Short Guide to the Use and Interpretation of v3.3/v3.4 Level
  1 Data' for additional information (http://mls.jpl.nasa.gov/data/Level_1_ReadMe_2013-05-09.pdf).nnUsers
  are encouraged to register with the MLS science team at https://mls.jpl.nasa.gov/forms/reguser.php
  to obtain updates and information about this data product.nnThe data are stored
  in the version 5 Hierarchical Data Format, or HDF5. Each file contains sets of HDF5
  dataset objects (n-dimensional arrays) for each measurement. Included in the file
  are file attributes and metadata. There is one file per day.\",\n\t\"license_title\":
